import logo from './platzi.webp';
import './App.css';

function App() {
	return (
		<div className="App">
			<header className="App-header">
				<img
					src={logo}
					className="App-logo"
					alt="logo"
				/>
				<p>Welcome!.</p>
				<a
					className="App-link"
					href="https://platzi.com/reactjs"
					target="_blank"
					rel="noopener noreferrer">
					Hello World!
				</a>
			</header>
		</div>
	);
}

function TodoItem() {
	return (
		<li>
			<span>✅</span>
			<p>Launch a Million dollar business</p>
			<span>❌</span>
		</li>
	);
}

export default App;
